情、八卦、生活”的娱乐风格在中国电视娱乐版图迅速卡位，其带动的明星效应和倡导的快乐理念至今生命力不减，十几年来已融为中国青少年文化的一部分，并为湖南卫视打造成中国第一电视娱乐品牌定下基调不仅是湖南卫视一直保持至今的品牌节目，也是中国电视界综艺娱乐节目的领头羊；同时也是中国最有影响力的娱乐节目之一甚至成为中国亿万观众娱乐生活的一部分。娱乐圈内的知名艺人几乎都曾经登上过《快乐大本营》的舞台，留下属于他们的精彩瞬间。《快乐大本营》新创意的主题性综艺节目，为普通观众或草根团体及组合打造了一个展现个性的“全民娱乐”平台和分享快乐的机会，同时也极力为电视机前的观众推介时尚、新奇的文艺表演形式，传递“快乐至上”的娱乐精神，突出了以观众为主体的“娱乐天下”的节目理念。";s:13:"vod_play_from";s:19:"zuidam3u8$$$172m3u8";s:15:"vod_play_server";s:7:"no$$$no";s:13:"vod_play_note";s:3:"$$$";s:12:"vod_play_url";s:13009:"2017-04-15期$http://shenling.dijiang-zuida.com/20170828/0Pu2TpEn/index.m3u8#2017-04-22期$http://shenling.dijiang-zuida.com/20170828/1pVYB4ra/index.m3u8#2017-04-29期$http://shenling.dijiang-zuida.com/20170828/RRT9N8WB/index.m3u8#2017-05-06期$http://shenling.dijiang-zuida.com/20170828/KHiad8hR/index.m3u8#2017-05-13期$http://shenling.dijiang-zuida.com/20170828/KdSiXfCY/index.m3u8#2017-05-20期$http://shenling.dijiang-zuida.com/20170828/X0Va4gPI/index.m3u8#2017-06-03期$http://shenling.dijiang-zuida.com/20170828/WVwXqC8K/index.m3u8#2017-06-10期$http://zouyu.laohu-zuida.com/20170610/JEhv5DMA/index.m3u8#2017-06-17期$http://zouyu.laohu-zuida.com/20170617/Djf6n4Ul/index.m3u8#2017-06-24期$http://zouyu.laohu-zuida.com/20170625/tQBl3TIt/index.m3u8#2017-07-01期$http://zouyu.laohu-zuida.com/20170702/KwifILFy/index.m3u8#2017-07-08期$http://zouyu.laohu-zuida.com/20170709/7BSTeXdT/index.m3u8#2017-07-15期$http://hao.zuida-youku.com/20170716/HJIESxcN/index.m3u8#2017-07-22期$http://shenling.dijiang-zuida.com/20170722/OmZh59ZR/index.m3u8#2017-07-29期$http://shenling.dijiang-zuida.com/20170729/lbuEDdTR/index.m3u8#20170805期$http://shenling.dijiang-zuida.com/20170805/yT45zgWK/index.m3u8#20170812期$http://zouyu.laohu-zuida.com/20170813/Zk6rJOH3/index.m3u8#20170819期$http://zouyu.laohu-zuida.com/20170819/R0J12yL4/index.m3u8#20170826期$http://zouyu.laohu-zuida.com/20170826/Ou4JmrEH/index.m3u8#20170902期$http://zouyu.laohu-zuida.com/20170902/dFdZdeHN/index.m3u8#20170909期$http://zouyu.laohu-zuida.com/20170909/1dr4aQTp/index.m3u8#20170916期$http://